import "./App.css";
import axios from "axios";
import React from "react";

class App extends React.Component {
  statte = { datails: [] };

  componentDidMount() {
    let data;
    axios
      .get("http://localhost:8000")
      .then((res) => {
        data = res.data;
        this.setState({ datails: data });
      })
      .catch((err) => {
        console.log(err);
      });
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Данные из Django</h1>
        </header>
        <p className="App-intro">
          To get started, edit <code>src/App.js</code> and save to reload.
        </p>
        <ul>
          {this.state.datails.map((datails) => (
            <li key={datails.id}>{datails.name}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default App;
